    false,nt"url": null,nt"notes": "Bottle and other data were collected in
    the Arctic and North Atlantic Oceans from the R/V EVERGREEN and other platforms
    from 13 July 1962 to 01 October 1975. Data include profiles of temperature, pH,
    and salinity. Data also include concentration profiles of total phosphate, nitrate,
    nitrite, oxygen, chlorophyll a, particulate organic carbon, ammonia, and silicate.
    Data were submitted by the Woods Hole Oceanographic Institute (WHOI) and are in
    a comma separated value (.csv) format.",nt"owner_org": "9cda5205-d632-4814-96e7-a4ab5e0dce85",nt"extras":
